class TaskDetailsComponent {
    constructor(taskService, route, router) {
        this.taskService = taskService;
        this.route = route;
        this.router = router;
        this.message = '';
    }
    ngOnInit() {
        this.message = '';
        this.getTask(this.route.snapshot.paramMap.get('id'));
    }
    getTask(id) {
        this.taskService.get(id)
            .subscribe((data) => {
            this.currentTask = data;
            console.log(data);
        }, error => {
            console.log(error);
        });
    }
    updateCompleted(status) {
        const data = {
            title: this.currentTask.title,
            description: this.currentTask.description,
            priority: this.currentTask.priority,
            developerId: this.currentTask.developerId,
            completed: status
        };
        this.taskService.update(this.currentTask.id, data)
            .subscribe(response => {
            this.currentTask.completed = status;
            console.log(response);
            this.message = 'The task was Completed!';
        }, error => {
            console.log(error);
        });
    }
    updateTask() {
        this.taskService.update(this.currentTask.id, this.currentTask)
            .subscribe(response => {
            console.log(response);
            this.message = 'The task was updated successfully!';
        }, error => {
            console.log(error);
        });
    }
    deleteTask() {
        this.taskService.delete(this.currentTask.id)
            .subscribe(response => {
            console.log(response);
            this.router.navigate(['api/tasks']);
        }, error => {
            console.log(error);
        });
    }
}
